(8, 'Koe no Katachi', 'Shoya is a bully. When Shoko, a girl who can\'t hear, enters his elementary school class, she becomes their favorite target, and Shoya and his friends goad each other into devising new tortures for her. But the children\'s cruelty goes too far. Shoko is forced to leave the school, and Shoya ends up shouldering all the blame. Six years later, the two meet again. Can Shoya make up for his past mistakes, or is it too late?', 'https://cdn.masterani.me/poster/1/1893neuYUyo0.jpg', 'https://cdn.masterani.me/wallpaper/0/1893HxCYm9K8.jpg', 'https://www.youtube.com/watch?v=XBNWo25izJ8', 'Anime', 'Drama, Animation', 'September 9, 2016', '9.2', '2h 10min', 'Shochiku', 'Japanese', '2018-10-06 00:19:49', '2018-10-06 10:36:22', 'https://vjs.zencdn.net/v/oceans.mp4', NULL, 'koe-no-katachi', ''),
